The Calvin Bryce Hoover papers span the years 1922-1970, with the bulk falling between
            1929 and 1968. The collection is arranged into nine series: Correspondence; Writings;
            Academic Materials; Professional Associations; Government Service; Subject Files;
            Audio-Visual Material; Personal; and Printed Material. The collection includes
            correspondence, departmental files, reports, photographs, sound recordings, books,
            articles, clippings, scrapbooks, date books, and other printed materials.
